import { combineReducers, createStore } from "redux";
import dg from "./dr";
import myp from "./mr";
import usersReducer from "./users";

let reducers = combineReducers({
  myPage: dg,
  messagePage: myp,
  usersReducer: usersReducer,
});

let store = createStore(reducers);

export default store;
